		add_203786(tmp_284502, experience_284032(makeNimstrLit("Netelip"), [makeNimstrLit("        Netelip was my first home, I had my intership there after I finished my latest studies, after 3 months of \x0A        intership I stayed there working, in total I spent there 1 year. My first job was to make a complex platform\x0A        to work, it was developed in symfony, but it was unusable due to the high latency (up to 5s to do any action)\x0A        in the frontend, the first thing I did was update to PHP7, just with that, it became much more responsive.\x0A        "), makeNimstrLit("        After that I introduced a real time monitoring system (which we watched on a big TV in the office), some services\x0A        connecting with Asterisk SIP using Janus Gateway, and a VPS service with NodeJS and Proxmox.\x0A        "), makeNimstrLit("        I learnt a lot in Netelip, but I was ambitious, and I wanted to experiment life outside of my city, so I moved to...\x0A        ")]));
		F.line = 136;
		add_203786(tmp_284502, experience_284032(makeNimstrLit("Indigitall"), [makeNimstrLit("        Indigitall is a startup located in Madrid, the company focused on its Push Notifications As a Service, again, my job was\x0A        to maintain and upgrade the backend they had in PHP, Symfony toom and I managed the servers too.\x0A        "), makeNimstrLit("        What I learnt the most here was to interact with clients. Because we where just 3 people, and we had big clients, I\x0A        had to email with clients, go to their offices, etc.\x0A        "), makeNimstrLit("        We had some interesting performance challenges, when Orange became a client, we instantly had 2 to send push notifications\x0A        to two million users, that was fun.\x0A        "), makeNimstrLit("        Although I was very happy here, I was not happy with the lifestyle in Madrid, and our house was too small, and the big distances!\x0A        Finally a chance to come back to M\xC3\xA1laga knocked my door, and in less than 2 weeks, I was back in M\xC3\xA1laga.\x0A        ")]));
		F.line = 148;
		add_203786(tmp_284502, experience_284032(makeNimstrLit("Accenture"), [makeNimstrLit("        My next adventure was in Accenture, this time I was contracted as Frontend Developer with React experience. I was happy to be\x0A        able to experience working in a big company. I learnt what bureaucracy is, big offices, a lot of people, and very big development\x0A        teams. It was interesting, I received a very good course from lemoncode.net about React + Redux-Observables. But once again, it was\x0A        not what I was looking for.\x0A        "), makeNimstrLit("        In a short time, few months, I saw myself wasting my time, spending hours and hours doing non-sense burocracy and I was not learning\x0A        anything new (at least programming related, I keep learning a lot of things about the company itself).\x0A        "), makeNimstrLit("        Finally, most of my mates leaved, and I did it too. Being in M\xC3\xA1laga again, there where a lot of possibilities near me.\x0A        ")]));
		F.line = 158;
		add_203786(tmp_284502, experience_284032(makeNimstrLit("Algorath"), [makeNimstrLit("        Algorath was a startup with just 3 people, placed next to the university of M\xC3\xA1laga. I worked here coding mainly in Go. It was my first \x0A        experience working with Go with an experienced team.\x0A        "), makeNimstrLit("        We worked together with an england company, Yoti, developing a distributed ledger to manage identities. I learnt a lot about Go and\x0A        well practices thanks to very good and experienced people [thanks Piers ;)]. After a few months I was in charge of developing a\x0A        mobile app using Go Mobile + React Native, we managed to launch a node of the ledger inside the phone.\x0A        "), makeNimstrLit("        My experience in Algorath was very confortable, and I learnt a lot. I\'m grateful for the time I spent there. But finally, one more chance\x0A        came to me. The chance of remote working...\x0A        ")]));
		F.line = 169;
		add_203786(tmp_284502, experience_284032(makeNimstrLit("Interacso"), [makeNimstrLit("        Interacso is my current company, I\'ve been working here for a full year now (that\'s a new thing to me). I closed the contract and start \x0A        working remotely without even visiting my company office. After few months, I went to Madrid to meet my mates in person.\x0A        "), makeNimstrLit("        Here in Interacso I develop mostly frontend with React, any kind of frontend. Mobile apps, desktop apps, browser apps, and even IoT apps. \x0A        I have tons of challenges nearly every week. I have awesome mates and leaders. And also to be able to live\x0A        anywhere I want, and to manage my time are things I will have it hard to say goodbay to.\x0A        "), makeNimstrLit("        I\'m so happy in Interacso that this year has passed very quickly to me.\x0A        ")]));
